import React from 'react';

import Pomodoro from "./components/pomodoro";


function App() {
  const timer = ({time, end}) => {
    let timeCounter = 0;

    const interval = setInterval(() => {
      timeCounter++;

      console.log(timeCounter, time)

      if (timeCounter === time) {
        console.log("end");
        clearInterval(interval);
      } 
    }, 1000)
  }

  timer({
    time: 5,
  })


  return (
    <Pomodoro
      onChangeBreakLength={() => console.log(1)}
      onChangeSessionLength={() => console.log(1)}

      onClickStart={() => console.log(1)}
      onClickStop={() => console.log(1)}
      onClickReset={() => console.log(1)}

      display={"00:00:00"}
    />
  );
}

export default App;
